import './workList.css';
import Work from '../work/Work';
import { work } from '../../data';

const WorkList = () => {
    return (
        <div className="workList">
            <div className="workList-text">
                <h1 className="workList-title"> &#128071; Here's some of my work</h1>
                <p className="workList-description">
                    Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                    Quisque sit amet pellentesque dolor. Suspendisse potenti.
                    In blandit elementum ligula vitae porta.
                </p>
            </div>
            <div className="workList-list">
                { work.map((item) => (
                    <Work key = {item.id} img = {item.img} link = {item.link}/>
                ))}
            </div>
        </div>
    )
}

export default WorkList;
